import React from 'react';

function App() {
  return (
    <div style={{ 
      display: 'flex', 
      flexDirection: 'column',
      alignItems: 'center', 
      justifyContent: 'center', 
      height: '100vh',
      fontFamily: 'sans-serif' 
    }}>
      <h1 style={{ color: '#008ECC' }}>MegaMart Rwanda</h1>
      <p>If you see this, your React app is finally working!</p>
      <div style={{ marginTop: '20px', padding: '10px', border: '1px solid #ddd' }}>
        Next step: Add code to HomePage.js
      </div>
    </div>
  );
}

export default App;
